import React, { Component } from 'react'
import UploadLoveFrames from './UploadComponent/UploadLoveFrames';
import UploadNaturePhotos from './UploadComponent/UploadNaturePhotos';

export class AddData extends Component {
    constructor(props){
        super(props);

        this.state = {}
    }

  render() {
    return (
        <div>
          <h3><b><u>|====Adding Data====|</u></b></h3>
          {console.log(this.props.triggerApp)}
          {
            this.props.triggerApp=== 'Love Photo Frames' && 
            <UploadLoveFrames
              trigger={this.props.trigger} 
              setTrigger={this.props.setTrigger} 
              pic={this.props.pic} 
              setPic={this.props.setPic} 
              dataTrigger={this.props.dataTrigger}
              setDataTrigger={this.props.setDataTrigger}
            /> 
          }

          {
            this.props.triggerApp=== 'Love Photo Frames' && 
            <UploadLoveFrames
              trigger={this.props.trigger} 
              setTrigger={this.props.setTrigger} 
              pic={this.props.pic} 
              setPic={this.props.setPic} 
              dataTrigger={this.props.dataTrigger}
              setDataTrigger={this.props.setDataTrigger}
            /> 
          }
     </div>
    )
  }
}

export default AddData
